import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';
import iconoNofovotiro from '../amor-y-romance.svg'


function ListadoFotos(){

    return(
   
         <Row style={{width:"100%"}} style={{margin:"0px"}}> 
             <Col md={4} lg={3} xs={12} className="justify-content-center">
             <Card className="cardImg"> 
                 <Card.Body className="cardBodyImg">

                 <img src="https://cdn.pixabay.com/photo/2015/04/23/21/59/tree-736875__340.jpg" className="card-img-top"></img>
                 
                    <Card.Footer>
                        <a href="#">
                            <img className="nav-link p-0 text-right m-0 icono" src={iconoNofovotiro} style={{height:"1rem"}}></img>
                        </a>
                        <p>hola</p>
                        
                        </Card.Footer>

                 </Card.Body>
             </Card>
             </Col>

         </Row>
       
    );
}

export default ListadoFotos;
